INSERT INTO `nb_classes` VALUES (54,'CL','Форм-фактор','Трансформер с поворотным экраном','','2_in_1'),(56,'CL','Форм-фактор','Большой экран 16\" и более','','16>'),(68,'CL','Форм-фактор','Ультракомпактный 13\"','','13inch'),(69,'CL','Форм-фактор','Компактный 14\"','','14inch'),(70,'CL','Форм-фактор','Стандартный размер 15\"','','15inch'),(71,'CL','Процессор','Младшего класса','Самые дешевые и низкопроизводительные процессоры, включая энергосберегающие серерии. \nIntel Celeron или Pentium Silver серии N (ядро процессора Atom)\n или AMD Athlon 3020e и подобные','CPU_Budget'),(72,'CL','Процессор','Стандартный мобильный','Основные семейства процессоров для ноутбуков:\nIntel Core, AMD Ryzen. Модели с индексом U.\nА также ARM-чипы Apple Silicon M1, Qualcomm Snapdragon 8</ul>','CPU_Standard'),(73,'CL','Процессор','Для продвинутых ноутбуков','Старшие процессоры для ноутбуков:\n Intel Core, AMD Ryzen. Модели с индексом H. \nРассчитанны на использование в моделях с дискретной графикой.','CPU_Perfomance'),(74,'CL','Графика','Встроенная','Только встроенная (интегрированная) в процессор графика. \nДля хранения грфических данных используется область основной оператитвной памяти.','GPU_Integrated'),(75,'CL','Графика','Легкая внешняя','Дискретная (внешняя) видеокарта начального уровня с собственной видеопамятью\nСерии<ul><li>NVidia MX</li><li>Intel Xe 11</li><li>Radeon R/RX, 500, 600</li></ul>','GPU_External_light'),(76,'CL','Графика','Игровая или профессиональная','Видеокарта игрового класса среднего или высокого уровня с собственной видеопамятью большого объема\n<strong>Среднего уровня:</strong><ul><li>Nvidia GTX</li><li>AMD RX5500</li></ul>\n<strong>Высокого уровня:</strong><ul><li>Nvidia RTX</li><li>AMD Radeon RX6700/6800, RX5600/5700</li></ul>\nПрофессиональные: <ul><li>Nvidia Quadro</li><li>RTX3000/RTX5000/RTX A</li><li>AMD Radeon Pro</li></ul>','GPU_External_TOP'),(77,'CL','Форм-фактор','Мини до 12\"','','12_mini'),(78,'GO','','Премиальный','Ноутбуки премиальных серий (кроме игровых), топовый дизайн, имидж','Premium'),(79,'GO','Коммерческий','Корпоративный','Бизнес-ноутбук топового уровня,  высокая прочность, PRO-компоненты, ср-ва безопасности, имидж','Corporate'),(80,'GO','Коммерческий','Бизнес средний','Стандартные бизнес-ноутбуки, устройства для сферы малого и среднего бизнеса, высокая прочность, ср-ва безопасности','SMB'),(81,'GO','Коммерческий','Для массовых рабочих мест','Бюджетные бизнес-ноутбуки для массовых рабочих мест и стандартных деловых приложений','Comm_efficient'),(82,'GO','Общее назначение','Для коммуникаций и просмотра','Ноутбуки для работы в Сети и потребления контента на энергосбрегающих или удешевленных процессорах.\n А также ультракомпактные ноутбуки (ультрабуки) на стандартных процессорах с экраном до 13\" включительно со встроенной графикой','Content_only'),(83,'GO','Общее назначение','Для обычной работы и учебы','Ноутбук для работы и учебы c экраном 14\", 15\" или 17\"\n\"Рабочая лошадка\";\nСтандартный мобильный процессор, встроенная графика.','Work_Horse'),(84,'GO','Общее назначение','Для творчества или разработки','Нотбук достаточной производительности для задач Content-creation или программирования. \nСтандартный или продвинутый процессор, с внешней графикой. С экраном от 14\" и более.','Content_creation'),(85,'GO','Общее назначение','Универсальный домашний','Универсальный ноутбук потребительского типа 15\"-17\"\nСтандартный или продвинутый процессор \nГрафика: встроенная, внешня легкая или игровая среднего уровня','Home_universal'),(86,'GO','','Ультрабук','Компактные ноутбуки с экраном от 12\", 13\" или 14\".\nНе смоторя на габариты - полнофункциональные устройства на базе стандартных мобильных процессоров.','Ultrabook'),(87,'GO','Общее назначение','Игровой','Стандартный или продвинутый процессор, игровая видеокарта среднего или высокого класса: Nvidia GTX/RTX или AMD RX','Gamer'),(88,'GO','Общее назначение','Профессиональная рабочая станция','Мощная машина для инженерных и дизайнерских задач, профессиональная видеокарта','Mobile_Workstation'),(89,'GO','','Простейший, начального уровня','Недорогой ноутбук для самых базовых задач. Процессор начального уровня, небольшой объем памяти; подойдет как первый ноутбук для школьника и студента, устройство для просмотра контента, коммуникаций, работы с простыми документами.','Beginner');
